  true,\n\t\"url\": null,\n\t\"notes\": \"The School Survey on Crime and Safety, 2008
  (SSOCS:2008), is a study that is part of the School Survey on Crime and Safety program.
  SSOCS:2008 (http://nces.ed.gov/surveys/ssocs/) is a cross-sectional survey of the
  nation's public schools designed to provide estimates of school crime, discipline,
  disorder, programs and policies. SSOCS is administered to public primary, middle,
  high, and combined school principals in the spring of even-numbered school years.
  \ The study was conducted using a questionnaire and telephone follow-ups of school
  principals.  Public schools were sampled in the spring of 2008 to participate in
  the study.  The studyufffds response rate was 74.5 percent.  A number of key statistics
  on a variety of topics can be produced with SSOCS data.\",\n\t\"license_title\":
